import {
    appbarHeight 
} from '../masterStyle.js';

const dashboardStyle = theme => ({
    container: {
        height: `calc(100% - ${appbarHeight})`,
        margin: "auto",
    },
    title: {
        padding: "1.5rem"
    },
    toolbar: theme.mixins.toolbar,
});

export default dashboardStyle;
